import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import {
  Box,
  Typography,
  Button,
  Grid,
  Tabs,
  Tab,
  Paper,
  Breadcrumbs,
  Link
} from '@mui/material';
import productos from '../../data/productos.json';

export default function Detalle() {
  const { id } = useParams();
  const [tabIndex, setTabIndex] = useState(0);

  const producto = productos.find((p) => String(p.id) === id);

  if (!producto) {
    return (
      <Box sx={{ mt: 8, px: 4 }}>
        <Typography variant="h6" color="error">
          Producto no encontrado
        </Typography>
      </Box>
    );
  }

  return (
    <Box sx={{ mt: 4, px: 4, maxWidth: '1200px', mx: 'auto' }}>
      {/* Breadcrumbs */}
      <Breadcrumbs separator=">>" sx={{ mb: 3 }}>
        <Link href="/" sx={{ color: '#4caf50', fontWeight: 'bold' }}>
          INICIO
        </Link>
        <Link href={`/productos/${producto.categoria.toLowerCase()}`} sx={{ color: '#4caf50', fontWeight: 'bold' }}>
          {producto.categoria.toUpperCase()}
        </Link>
        <Typography sx={{ color: '#4caf50', fontWeight: 'bold' }}>
          {producto.nombre.toUpperCase()}
        </Typography>
      </Breadcrumbs>

      <Grid container spacing={4} alignItems="center">
        {/* Imagen */}
        <Grid item xs={12} md={5}>
          <Paper elevation={3} sx={{ borderRadius: 3, p: 1 }}>
            <img
              src={producto.imagen}
              alt={producto.nombre}
              style={{
                width: '100%',
                borderRadius: 8,
                boxShadow: '0 4px 10px rgba(0,0,0,0.15)'
              }}
            />
          </Paper>
        </Grid>

        {/* Info principal */}
        <Grid item xs={12} md={7}>
          <Typography variant="h4" sx={{ fontWeight: 'bold', color: '#4caf50', mb: 1 }}>
            {producto.nombre.toUpperCase()}
          </Typography>

          <Typography variant="h6" sx={{ fontWeight: 'bold', color: '#000', mb: 3 }}>
            {producto.tipo.toUpperCase()}
          </Typography>

          {producto.botones?.map((btn, i) => (
            <Button
              key={i}
              variant="contained"
              href={btn.url}
              target="_blank"
              sx={{
                bgcolor: '#f7931e',
                color: '#fff',
                fontWeight: 'bold',
                borderRadius: 20,
                px: 4,
                py: 1.5,
                boxShadow: '0 4px 10px rgba(0,0,0,0.2)',
                '&:hover': {
                  bgcolor: '#e07c00'
                }
              }}
            >
              {btn.label.toUpperCase()}
            </Button>
          ))}
        </Grid>
      </Grid>

      {/* Tabs */}
      <Box sx={{ mt: 6 }}>
        <Box
          sx={{
            borderBottom: '5px solid #4caf50',
            mb: 2,
            mx: 'auto',
            maxWidth: 1000
          }}
        />

        <Tabs
          value={tabIndex}
          onChange={(_, val) => setTabIndex(val)}
          centered
          TabIndicatorProps={{ style: { backgroundColor: '#4caf50', height: 3 } }}
          sx={{
            '& .MuiTab-root': {
              fontWeight: 'bold',
              color: '#a5d6a7',
              fontSize: '16px',
              mx: 1
            },
            '& .Mui-selected': {
              color: '#4caf50',
              textDecoration: 'underline'
            }
          }}
        >
          <Tab label="DESCRIPCIÃ“N" />
          <Tab label="TIPO" />
          <Tab label="SUBTIPO" />
          <Tab label="PRESENTACIONES" />
          <Tab label="MODO DE USO" />
        </Tabs>

        <Box sx={{ mt: 3, px: 3, textAlign: 'center' }}>
          {tabIndex === 0 && <Typography>{producto.descripcion}</Typography>}
          {tabIndex === 1 && <Typography>{producto.tipo}</Typography>}
          {tabIndex === 2 && <Typography>{producto.subtipo || 'No especificado'}</Typography>}
          {tabIndex === 3 && <Typography>{producto.presentaciones}</Typography>}
          {tabIndex === 4 && <Typography>{producto.modoDeUso}</Typography>}
        </Box>
      </Box>
    </Box>
  );
}
